import React from 'react';
import megalogo from '../img/logo-Abril.jpg'; // Tell webpack this JS file uses this image

console.log(megalogo); // /logo.84287d09.png

function Header() {
  // Import result is the URL of your image
  return <img src={megalogo} width="100" height="100"  alt="" />;
}

export default Header;
